import React from 'react';
import{ View,Text,styleSheet } from 'react-native';

const Login=()=>{
    return(
        <View style={styles.container}>
            <Text>Hello Login</Text>
        </View>
    )
}

export default Login;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  });
